INSERT INTO `articolo` (`id`, `titolo`, `data_uscita`, `durata`, `trama`, `votazione`, `prezzo`, `locandina`, `categoria`) VALUES (NULL, 'Crudelia', '2021-11-09', '125 min', 'Ambientato durante la rivoluzione punk rock nella Londra degli anni Settanta, Crudelia segue le vicende di una giovane truffatrice di nome Estella, una ragazza intelligente e creativa determinata a farsi un nome con le sue creazioni. Fa amicizia con una coppia di giovani ladri che apprezzano la sua inclinazione alla cattiveria e insieme riescono a costruirsi una vita per le strade di Londra. Un giorno, il talento di Estella per la moda cattura l’attenzione della Baronessa von Hellman, una leggenda della moda incredibilmente chic e terribilmente raffinata, interpretata dall’attrice due volte premio Oscar® Emma Thompson (Casa Howard, Ragione e sentimento). Ma la loro relazione mette in moto una serie di eventi e rivelazioni che portano Estella ad abbracciare il suo lato malvagio e a diventare la prorompente, alla moda e vendicativa Cruella.', NULL, '40.00', , 'Film Disney');
INSERT INTO `articolo` (`id`, `titolo`, `data_uscita`, `durata`, `trama`, `votazione`, `prezzo`, `locandina`, `categoria`) VALUES (NULL, 'Black Widow', '2021-09-19', '140 min', 'La Vedova Nera, conosciuta anche come Natasha Romanova, collabora con i servizi segreti sovietici per diventare il loro agente principale. Tuttavia, quando l\'URSS si disgrega, il governo cerca di ucciderla.', NULL, '30.00', , 'Film Disney'), 
(NULL, 'Luca', '2021-08-31', '97 min', 'Ambientato in una splendida città di mare della riviera ligure, l’originale film d’animazione è la storia di un giovane ragazzo che vive un’esperienza di crescita personale durante un’indimenticabile estate contornata da gelati, pasta e infinite corse in scooter. Luca condivide queste avventure con il suo nuovo migliore amico, ma tutto il divertimento è minacciato da un segreto profondo: lui in realtà è un mostro marino di un altro mondo situato appena sotto la superficie dell’acqua.', NULL, '35.00', , 'Cartone Pixar');
