INSERT INTO `regia` (`id`, `nome`, `cognome`, `anno_nascita`, `eta`, `nazionalità`, `paese_nascita`, `biografia`, `foto`) VALUES
(11, 'Jon', 'Favreau', '1966-10-19', 54, 'Americana', 'Stati Uniti d\'America', 'Nasce a Flushing, un quartiere del Queens (New York) da padre statunitense di origini franco-canadesi e italiane, Charles Favreau, e da madre statunitense, Madeleine Favreau, morta di leucemia quando Jon aveva 13 anni. Ha studiato presso il Bronx High School of Science, e ha frequentato il Queens College dal 1984 al 1987. Partecipa ad alcune serie televisive come Friends, Chicago Hope e Seinfeld. Nel 1993 è interprete e sceneggiatore di Swingers, al fianco dell\'amico Vince Vaughn.\r\n\r\nNel 1998 recita nei film Cose molto cattive con Cameron Diaz ed è il medico Gus Partenza in Deep Impact, che riscuote grande successo. Nel 2000 prende parte a Le riserve, mentre nel 2001 esordisce alla regia dirigendo il film Made - Due imbroglioni a New York, di cui è anche sceneggiatore. Nel 2003, oltre a recitare nel film Daredevil ricoprendo il ruolo di Foggy Nelson, è regista del film natalizio Elf - Un elfo di nome Buddy, il cui protagonista è Will Ferrell. Nel 2004 recita nella commedia Tutto può succedere - Something\'s Gotta Give con Jack Nicholson e Diane Keaton, e nel 2006 torna alla regia con il film di fantascienza Zathura - Un\'avventura spaziale.\r\n\r\nNel 2007 dirige la trasposizione cinematografica del fumetto Iron Man, con Robert Downey Jr. e Gwyneth Paltrow e nel 2010 ne dirige il sequel Iron Man 2, ai quali partecipa anche come attore nel ruolo di Happy Hogan, ruolo che riprende nel 2013 nel terzo film sul supereroe, che però non dirige. Sempre nel 2013 prende parte al film The Wolf of Wall Street in cui recita la parte dell\'avvocato Manny Riskin. Torna dietro la macchina da presa nel 2011 per dirigere il fantawestern Cowboys & Aliens e nel 2014 per Chef - La ricetta perfetta, pellicola che ha anche scritto, prodotto e interpretato.\r\n\r\nNel 2016, Favreau firma la regia de Il libro della giungla, remake in live-action dell\'omonimo Classico Disney del 1967. Nel cast in qualità di doppiatori sono presenti Bill Murray nel ruolo dell\'orso Baloo, Ben Kingsley nel ruolo della pantera nera Bagheera, Scarlett Johansson come voce del pitone Kaa, Christopher Walken come voce dello scimmione Re Luigi e Idris Elba come voce della tigre Shere Kaan. Il film, costato 175 milioni di dollari, ne incassa 965 in tutto il mondo, ricevendo ottime critiche. Lo stesso anno la Disney conferma che girerà il sequel de Il libro della giungla e il remake in live-action de Il Re Leone.[1] Nel 2017 torna a interpretare il ruolo di Happy Hogan in Spider-Man: Homecoming, ruolo che ha ripreso in Avengers: Endgame e in Spider-Man: Far from Home, uscito nel luglio 2019.', );
INSERT INTO `regia` (`id`, `nome`, `cognome`, `anno_nascita`, `eta`, `nazionalità`, `paese_nascita`, `biografia`, `foto`) VALUES
(12, 'David', 'Yates', '1969-01-27', 51, 'Tedesco', 'Svizzera', 'Nato nella Germania Ovest, figlio di un medico tedesco e di un\'architetta svizzera, è cresciuto a Davos, in Svizzera. A vent\'anni si sposta a New York per studiare cinematografia all\'Università di New York. La sua carriera inizia realizzando alcuni documentari per la televisione, successivamente realizza alcuni film indipendenti a basso costo, Loungers e Everything Put Together, quest\'ultimo presentato al Sundance Film Festival. Il suo primo film importante è Monster\'s Ball - L\'ombra della vita, che viene candidato all\'Oscar, in seguito dirige Neverland - Un sogno per la vita, che ha avuto una nomination agli Oscar come Miglior Film.\r\n\r\nNel 2007 adatta per il grande schermo il romanzo di Khaled Hosseini Il cacciatore di aquiloni e viene scelto come regista di Quantum of Solace, 22º capitolo delle avventure di James Bond. Nel 2013 viene scelto per dirigere World War Z, film interpretato da Brad Pitt, che si rivela un grande successo al box office. Dopo aver girato Chiudi gli occhi - All I See Is You, nel novembre 2016 viene scelto dalla Walt Disney Pictures per dirigere Ritorno al Bosco dei 100 Acri, film in live action col personaggio Disney Winnie the Pooh.', );
INSERT INTO `regia` (`id`, `nome`, `cognome`, `anno_nascita`, `eta`, `nazionalità`, `paese_nascita`, `biografia`, `foto`) VALUES
(13, 'Emma', 'Watson', '1990-04-15', 31, 'Inglese', 'Inghilterra', 'Ha raggiunto la fama mondiale dopo aver interpretato, dal 2001 al 2011, il personaggio di Hermione Granger nella serie cinematografica di Harry Potter. Nel 2013 per l\'interpretazione di Sam in Noi siamo infinito vince il premio come miglior attrice assegnato ai San Diego Film Critics Society Awards, un People\'s Choice Award alla miglior attrice in un film drammatico e svariati altri riconoscimenti. Nel corso dello stesso anno è stata premiata agli MTV Movie Awards con l\'MTV Trailblazer Award, assegnato a \"un attore di giovane età che è riuscito a ispirare gli altri con un portafoglio diversificato di lavoro e una reputazione trascendente agli occhi del pubblico\". Nel 2014 riceve il premio BAFTA come migliore artista inglese dell\'anno, mentre nel 2015 la rivista Time la inserisce nella lista delle 100 persone più influenti del mondo. È nata il 15 aprile 1990 a Parigi, dove ha vissuto fino all\'età di cinque anni, figlia di Jacqueline Luesby e Chris Watson. In seguito al divorzio dei genitori, i figli si stabilirono con la madre nell\'Oxfordshire, trascorrendo però alcune settimane presso la casa del padre a Londra. Ha frequentato i primi due anni all\'Università Brown di Rhode Island , studiando Storia, per poi spostarsi all\'Università di Oxford, presso il Worcester College. Per l\'ultimo anno di studi ritorna all\'Università Brown, per poi laurearsi, il 25 maggio 2015, in Letteratura inglese.', );
